import React, {useState, useEffect} from "react";
import {listDecks} from "../utils/api/index";


function DecksDisplay() {
    const [decks, setDecks] = useState([]);

    useEffect(() => {
        async function loadData() {
            try {
                const data = await listDecks();
                setDecks(data);
            }// end of try
            catch(error) {
                console.log(error)
            }// end of catch
        } // end of loadData()
        loadData();
    },[]) //end of effect

return (
    <div>
        {decks.map((deck) => (
            <p>{deck.name}</p>
        ))}
    </div>
)










} //end of DecksDisplay()


